    Elections Commission  Attention:  James McAllister, Sr. Reports Finance Analyst
    \ 999 E Street, NW  Washington, DC  20463    Dear Mr. McAllister,    The Committee
    is in receipt of your letter, dated February 26, 2013, concerning the 2012 30-Day
    Post-General Report.    The Committee offers the following response:    1.\tIn
    regards to the transfers disclosed on Schedule A, Line 12 from the DNC, DCCC,
    and DSCC, please note that no funds transferred into the Committee were earmarked
    for any exempt activity.  These costs met all requirements for exempt activity
    rules.  The Committee's safe harbor practices were in place to ensure this.  2.\tThe
    payments disclosed on Line 30(b) for GOTV Telephone Calls/Volunteer Staffed, Postage,
    Volunteer Exempt mail piece have been clarified with more detailed purpose code
    and candidate name if applicable. Please note that these payments met all the
    requirements for exempt activity and GOTV rules for presidential phone banking.
    \ The Committee's safe harbor practices were in place to ensure this.  3.\tSchedule
    H2 has been amended to show the ratio for DMail 12-7 as New  4.\tSchedule H6,
    Line 30(a) payments for GOTV Postage, GOTV Newspaper Ad, GOTV Mail did not refer
    to a clearly identified federal candidate nor did they promote, support, attack
    or oppose a clearly identified federal candidate.  The payments met all the requirements
    for GOTV rules. The Committee's safe harbor practices were in place to ensure
    this.        If you have any additional questions regarding this response, please
    contact the Committee at your convenience.        Sincerely,        Habib Habib
    \   Treasurer  Please note that employees of the Committee that spent less than
    25% of their time on Federal Election Activity were paid on the Schedule H4 uniform
    split.  Expenditures listed on Line 21B did NOT meet the definition of Federal
    Elections Activity. In addition, all fundraising, event, and related payments
    made during this period were Committee fundraising and not on behalf of a Federal
    Candidate.   Please also note that the payments made to vendors for Party Fundraising
    Consulting  are based on a contractual set amount per month without regard to
    the percentage of funds raised.  Due to the contractual agreement, the FEC Reports
    Analysis Supervisor has ruled that the payments qualify as Admin instead Fundraising
    and may be reported on Schedule H4.\n"
